perspectives.style:
@controls {
  top {
    filter {
      target: element;
      by: "element type";
      as: buttons;
      multiple: true;
      default: show-all;
    }
  }
}

@settings {
  template: stakeholder;
  direct-decorations: true;
  theme: light;
  element-color: categorize("Element Type", paired);
}
